import React,{useState} from 'react';
import Footer from './Footer';
import Presentation from './Presentation';
import {Modal,Button} from 'react-bootstrap'
const Admin = () => {
    const [show, setShow] = useState(false);
    const [nomVehicule, setNomVehicule] = useState()

    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);

    const SaveCar = () => {
        console.log("le nom de votre vehicule" + nomVehicule)
    }
    return (
        <div>
            <Presentation/>
                <div style={{display:'flex'}}>
                    <div className="AjoutVoitureDiv">
                        <a className="ajouterVoiture" onClick={handleShow}> Ajouter une nouvelle Voiture </a>
                    </div>
                    <div className="AjoutVoitureDiv">
                        <a className="ajouterVoiture"> Actualiser </a>
                    </div>

                <Modal show={show} onHide={handleClose}>
                        <Modal.Header closeButton>
                        <Modal.Title>Modal heading</Modal.Title>
                        </Modal.Header>
                        <Modal.Body>Woohoo, you're reading this text in a modal!
                           <input type="text" placeholder="nom de la voiture" onChange={(event) => setNomVehicule(event.target.value)}/><br/><br/>
                           <input type="text" placeholder="marque de la voiture" onChange={(event) => setNomVehicule(event.target.value)}/><br/><br/>
                           <input type="text" placeholder="entrer votre nom" onChange={(event) => setNomVehicule(event.target.value)}/><br/><br/>
                           <input type="text" placeholder="entrer votre nom" onChange={(event) => setNomVehicule(event.target.value)}/><br/><br/>
                           <input type="text" placeholder="entrer votre nom" onChange={(event) => setNomVehicule(event.target.value)}/><br/><br/>
                           <input type="text" placeholder="entrer votre nom" onChange={(event) => setNomVehicule(event.target.value)}/><br/><br/>
                           <input type="text" placeholder="entrer votre nom" onChange={(event) => setNomVehicule(event.target.value)}/><br/><br/>
                           <input type="text" placeholder="entrer votre nom" onChange={(event) => setNomVehicule(event.target.value)}/><br/><br/>
                        </Modal.Body>
                        <Modal.Footer>
                        <Button variant="secondary" onClick={handleClose}>
                            Close
                        </Button>
                        <Button variant="primary" onClick={SaveCar}>
                            Save Changes
                        </Button>
                        </Modal.Footer>
                </Modal>
                </div>
            <Footer/>
        </div>
    );
};

export default Admin;
